webpackJsonp([0xec3452c3ce38],{356:function(a,n){a.exports={data:{markdownRemark:{html:'<p>Post kedua bukan sekadar wacana yeay <img class="emoji-icon" data-icon="emoji-laughing" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, " />.</p>\n<p>Kali ini saya akan membahas tentang jalur olimpiade di UI. Kenapa saya membahas ini? <del>Karena saya gabut</del> Karena dulu saya bingung tentang jalur olimpiade untuk masuk PTN (atau bahkan ada atau tidak) dan saya tidak menemukan blog-blog yang membahas demikian. Berhubung sekarang adalah masa-masa maba berkunjung ke sekolahnya untuk <del>pamer</del> promosi PTN, terbesit di benak saya untuk membuat post ini. Siapa tahu di masa depan ada orang-orang seperti saya, yang mencari informasi tentang jalur olimpiade, berkunjung ke blog ini.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/patron-f0377b3b6fafd889f5da3734e71db25b-db28a.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75.69444444444444%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Patrick di masa depan"\n        title=""\n        src="/static/patron-f0377b3b6fafd889f5da3734e71db25b-10273.png"\n        srcset="/static/patron-f0377b3b6fafd889f5da3734e71db25b-9b14a.png 163w,\n/static/patron-f0377b3b6fafd889f5da3734e71db25b-94962.png 325w,\n/static/patron-f0377b3b6fafd889f5da3734e71db25b-10273.png 650w,\n/static/patron-f0377b3b6fafd889f5da3734e71db25b-2fc6f.png 975w,\n/static/patron-f0377b3b6fafd889f5da3734e71db25b-a8a2c.png 1300w,\n/static/patron-f0377b3b6fafd889f5da3734e71db25b-db28a.png 1440w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Ilustrasi orang di masa depan</em></p>\n<p>Pertama-tama, ini adalah cerita pengalaman saya sebagai anak komputer sehingga untuk bidang lain mungkin kurang sesuai sehingga saya akan mencoba memberikan informasi yang saya tahu secara umum terlebih dahulu, silakan dikoreksi jika salah. Ada dua universitas yang memberikan jalur khusus olimpiade, yaitu UI dan UGM. Universitas lain mungkin juga memberikan keringanan namun lewat jalur SNMPTN dengan melampirkan sertifikat dan menghubungi panitia yang bersangkutan. Perlu diperhatikan bahwa ada sebuah PTN di Bandung yang benar-benar tidak peduli terhadap OSN sehingga jika nilaimu tidak terlalu bagus dan kamu mau cari aman, jangan daftar SNMPTN di PTN tersebut karena sudah merenggut ribuan korban jiwa <img class="emoji-icon" data-icon="emoji-grin" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, " />. Untuk bidang ekonomi, ada surat pernyataan dari FEB UI pada saat registrasi peserta OSN tentang kesediaan masuk FEB UI namun saya tidak tahu berapa orang yang diambil dan saya yakin bukan 90 orang (semua peserta). Untuk bidang kimia saya punya teman yang ditawari program S1 &#x26; S2 kimia di UI. Namun perlu diperhatikan bahwa walaupun ada jalur olimpiade ini, tetap saja peminatnya sedikit kecuali komputer karena mungkin anak-anak OSN lebih tertarik ke jurusan-jurusan terapan yang tidak memiliki jalur olimpiade walaupun bidangnya berkaitan (kedokteran dengan biologi, teknik dengan fisika, dll).</p>\n<p>Untuk bidang komputer sendiri, kamu dapat mendaftar beasiswa full ke salah satu universitas swasta yang terkenal akan shitposting dan ayam rockynya dengan melampirkan sertifikat tingkat nasional. Selain itu, jika kamu berhasil mencapai tahap pelatnas 2 (16 besar TOKI), kamu akan mendapat undangan untuk masuk Fasilkom UI walaupun tanpa beasiswa. Undangan Fasilkom inilah yang akan menjadi topik bahasan saya kali ini.</p>\n<p>Saya pertama kali tahu informasi tentang undangan ini dari Indra saat pelatda OSN DKI Jakarta. Kebetulan saat itu juga sedang ramai SBMPTN sehingga Dia menceritakan jalur tersebut kepada kami teman-teman kamarnya. Saat itu saya belum memikirkan tentang PTN sehingga tidak ambil pusing dengan informasi tersebut. Saat pelatnas 1, bersamaan dengan runtuhnya nilai-nilai saya di sekolah, keinginan untuk mendapatkan undangan tersebut muncul. Sepertinya lolos ke pelatnas 2 sangat worth it karena undangan tersebut. Bahkan, Indra yang simulasinya hancur mulai memikirkan undangan UInya. Oh iya, Indra merupakan veteran pelatnas 2 tahun lalu dan sebenarnya jika sudah pernah mencapai pelatnas 2, seharusnya tetap mendapat undangan walaupun tidak berhasil ke pelatnas 2 di tahun selanjutnya. Tapi ya namanya juga panik ya <img class="emoji-icon" data-icon="emoji-stuck_out_tongue_winking_eye" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, " />. Akhirnya tibalah penutupan pelatnas 1 dan saya dinyatakan lolos ke pelatnas 2. Saya juga mendapat souvenir topi ITB (karena pelatnas 1 di ITB) sehingga saat itu saya <em>resmi</em> menjadi anak UI bertopi ITB. Oh iya, karena informasi lolos ke pelatnas 2 ini diberitahukan saat pelatnas 1 yang diadakan sekitar bulan Oktober, jika kamu tidak lolos sebenarnya masih memiliki banyak waktu untuk memperbaiki nilai sekolah serta belajar SBMPTN.</p>\n<p>Saat pelatnas 2, di saat anak-anak lain fokus untuk lolos ke pelatnas 3, saya dan Indra hanya memikirkan UI (tapi dia lolos ke pelatnas 3, trap emang). Saat itu di pagi hari, diadakan latihan seperti biasa. Seperti biasa, saya hanya dapat melihat-lihat kesana kemari meratapi soal-soal yang tidak bisa dikerjakan ini. Akhirnya, ada notifikasi muncul. “Dra, lihat email” ujarku kepada Indra yang berada di depanku. Ya, ada email dari pihak UI mengenai jalur olimpiade. Terlihat belum resmi dan hanya ingin mendata apakah bersedia masuk UI, mungkin untuk pendataan kuota SNMPTN. Selang beberapa hari, akhirnya undangan resmi itu datang.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/undangan-0638ab4dc7a9e7a225eac4d997e783bd-8c91a.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 140.06410256410254%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Undangan dari UI"\n        title=""\n        src="/static/undangan-0638ab4dc7a9e7a225eac4d997e783bd-10273.png"\n        srcset="/static/undangan-0638ab4dc7a9e7a225eac4d997e783bd-9b14a.png 163w,\n/static/undangan-0638ab4dc7a9e7a225eac4d997e783bd-94962.png 325w,\n/static/undangan-0638ab4dc7a9e7a225eac4d997e783bd-10273.png 650w,\n/static/undangan-0638ab4dc7a9e7a225eac4d997e783bd-2fc6f.png 975w,\n/static/undangan-0638ab4dc7a9e7a225eac4d997e783bd-8c91a.png 1248w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Pendaftaran ini dimulai beberapa hari sebelum SNMPTN ditutup. Untung saya belum daftar SNMPTN jadi kuotanya bisa dikasih ke orang lain. Jalur inipun cukup unik, sama sekali tidak ada informasi di website-website resmi UI. Kami mengisi data di website SIMAK UI. Setelah itu, cukup tunggu hingga tanggal pendaftaran ulang seperti jalur reguler biasa. Kalau anak reguler membawa rapot, ijazah, dll kami hanya disuruh membawa sertifikat, itupun akhirnya tidak dicek di sana. heran. Setelah itu, cukup menjadi mahasiswa biasa.</p>\n<p>Masuk melalui jalur olimpiade memiliki beberapa perbedaan. Pertama, Nomor Pokok Mahasiswa (NPM) kamu akan berurutan dengan TOKI lain sehingga jika kamu sekelas dengan TOKI lain yang absennya sorted by NPM, absen kalian akan berjajar. Tentu jika ada pembuatan grup yang berdasarkan NPM kalian juga akan bersama. Kedua, pembimbing akademis (PA) kalian adalah dekan yang menjabat saat itu. Hal ini mungkin berguna karena ada mata kuliah CP yang bernama TK TPL (pahlawan biasanya pakai nama samaran - Pak Denny) yang prerequisitenya 100 SKS/matkul Struktur Data dan Algoritma namun bisa kalian ambil pada semester 2 jika kamu TOKI. Tentu kamu tidak perlu menjelaskan kamu TOKI jika PAnya sama karena mengambil suatu matkul butuh persetujuan PA.</p>\n<p>Oke sekian saja pos kali ini (kok jadi panjang <img class="emoji-icon" data-icon="emoji-joy" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, " />)!</p>',frontmatter:{title:"Masuk Universitas Indonesia melalui Jalur Olimpiade",date:"15 January 2018",description:"Pengalaman saya diterima Universitas Indonesia (UI) melalui jalur olimpiade (prestasi). Berisikan informasi-informasi tentang jalur olimpiade yang saya ketahui pada PTN-PTN di Indonesia."},fields:{slug:"/masuk-ui-jalur-olimpiade/"}}},pathContext:{slug:"/masuk-ui-jalur-olimpiade/"}}}});
